import React from "react";

import "./Button.css";

function Button({ text = "asasdad" , laclase = "warning" }) {
	// this.setState({laclase: "warning"});
	return (
		<button className={props.laclase} onClick={props.onClick}>
			<span></span>
			<p>{props.texto}</p>
		</button>
	);
}
	
export default Button;
